import { computed, PropType, defineComponent } from 'vue';
import renderFn from '../utils/render-fn';
import {
  TdIconSVGProps, SVGJson,
} from '../utils/types';
import useSizeProps from '../utils/use-size-props';

import '../style/css';

const element: SVGJson = {"tag":"svg","attrs":{"fill":"none","viewBox":"0 0 24 24","width":"1em","height":"1em"},"children":[{"tag":"path","attrs":{"fill":"currentColor","d":"M13 1v1.08A6 6 0 0118 8h4v14H2V8h4a6 6 0 015-5.92V1h2zM8 8h8a4 4 0 00-8 0zm-4 4.54a3.98 3.98 0 015 .81 3.99 3.99 0 016 0 3.99 3.99 0 015-.81V10H4v2.54zM8 16a2 2 0 10-4 0v4h4v-4zm2 4h4v-4a2 2 0 10-4 0v4zm6 0h4v-4a2 2 0 10-4 0v4z"}}]};

export default defineComponent({
  name: 'Castle7Icon',
  props: {
    size: {
      type: String,
    },
    onClick: {
      type: Function as PropType<TdIconSVGProps['onClick']>,
    },
  },
  setup(props, { attrs }) {
    const propsSize = computed(() => props.size);

    const { className, style } = useSizeProps(propsSize);

    const finalCls = computed(() => ['t-icon', 't-icon-castle-7', className.value]);
    const finalStyle = computed(() => ({ ...style.value, ...(attrs.style as Styles) }));
    const finalProps = computed(() => ({
      class: finalCls.value,
      style: finalStyle.value,
      onClick: (e:MouseEvent) => props.onClick?.({ e }),
    }));
    return () => renderFn(element, finalProps.value);
  },

});
